CREATE DATABASE earlycart;

USE earlycart;

CREATE TABLE users (
    id VARCHAR(255) PRIMARY KEY,
    pw VARCHAR(255),
    name VARCHAR(255),
    birth VARCHAR(255),
    phone VARCHAR(255),
    role VARCHAR(255),
    session VARCHAR(255)
);

CREATE TABLE categories (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(255),
    image VARCHAR(255) 
);

CREATE TABLE items (
    id INT AUTO_INCREMENT PRIMARY KEY,
    category VARCHAR(255),
    name VARCHAR(255),
    price INT,
    stock INT,
    barcode VARCHAR(255),
    image VARCHAR(255) 
);

CREATE TABLE orders (
    id INT AUTO_INCREMENT PRIMARY KEY,
    user_id VARCHAR(255),
    cart_id INT,
    name VARCHAR(255),
    price INT,
    image VARCHAR(255),
    status INT,
    date VARCHAR(255),
    FOREIGN KEY (user_id) REFERENCES users(id)
);

CREATE TABLE order_items (
    id INT AUTO_INCREMENT PRIMARY KEY,
    order_id INT,
    item_id INT,
    item_name VARCHAR(255),
    quantity INT,
    price INT,
    FOREIGN KEY (order_id) REFERENCES orders(id),
    FOREIGN KEY (item_id) REFERENCES items(id)
);




